import React from "react";
import Header from "../components/Header";
import "../screens/crm.css";

const StuProfile = () => {
  return (
    <div className="page">
      <Header title="üë§ Profile" />

      <div className="card">
        <h3>Personal Information</h3>
        <p><strong>Name:</strong> John Doe</p>
        <p><strong>Email:</strong> john@example.com</p>
        <p><strong>Phone:</strong> 9876543210</p>
      </div>

      <div className="card">
        <h3>Uploaded Documents</h3>
        <ul>
          <li>ID Proof: ‚úÖ Uploaded</li>
          <li>Marksheet: ‚úÖ Uploaded</li>
          <li>Photo: ‚ùå Not Uploaded</li>
        </ul>
      </div>

      <div className="card">
        <h3>Applications</h3>
        <table className="table">
          <thead>
            <tr><th>Course</th><th>Status</th><th>Date Applied</th></tr>
          </thead>
          <tbody>
            <tr><td>Full Stack Development</td><td>Shortlisted</td><td>2025-08-10</td></tr>
            <tr><td>Data Science</td><td>Applied</td><td>2025-08-15</td></tr>
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default StuProfile;

